import React from 'react'
import { ProductConsumer } from '../context/context'

export default class SideBar extends React.Component{
    render(){
        return(
            <ProductConsumer>
                {value => {
                    const {links, sidebarOpen, handleSidebar} = value
                    return(
                        <SideWrapper show = {sidebarOpen}>
                            <ul>
                                {
                                    links.map()
                                }
                            </ul>
                        </SideWrapper>
                    )
                }}
            </ProductConsumer>
        )
    }
}
